   "source": [
    "#correlation between price and number of rooms \n",
    "ggplot(data = melb_data, mapping = aes(x= Price, y= Rooms))+\n",
    "  geom_jitter(alpha=0.5)+geom_rug(position = \"jitter\", size=.08)+\n",
    "  geom_smooth(linewidth=0.7)+\n",
    "  stat_cor(method = \"pearson\", label.x = 15000, label.y = 10)+\n",
    "  labs(title = \"Sales vs Profit\", x=\"Price\", y=\"Rooms\")+\n",
    "  theme_minimal()"
   ]
  },
